    true,nt"url": null,nt"notes": "The purpose of the project is to detect
    unreported Supplemental Security Income (SSI) recipient admissions to Title XIX
    institutions. A file containing SSN's of SSI recipients (all eligible individuals
    and members of eligible couples in current pay) will be matched against the Health
    Care Financing Administration's (HCFA) Minimum Data Set (MDS) database which contains
    admission, discharge, re-entry and assessment information about persons in Title
    XIX facilities for all 50 States and Washington, D.C. This database is updated monthly.
    The match will produce an output file containing MDS data pertinent to SSI eligibility
    on matched records. This data will be compared back to the SSR data to generate
    alerts to the Field Offices for their actions.",nt"license_title": "Other
